import React from "react"
import MojProfilPrikaz from "./MojProfilPrikaz";

class MojProfil extends React.Component{

    constructor(){
        super()
        this.state = {
            user:"",
            password:""
        }
        this.handleClick=this.handleClick.bind(this)
        this.handleChange=this.handleChange.bind(this)

    }

    componentDidMount(){
        var config={
            method: 'get',
            headers: {'Authorization': 'Bearer ' + localStorage.getItem('jwt')}
          };

        fetch('http://localhost:8080/bioskop/users/'+this.props.state.logedUsername+'/null/null',config)
            .then(res => res.json())
            .then(res => {
                console.log(res)
                this.setState({
                    user: res[0]
                })
            })
    }

    handleChange(event){
        const {name,value} = event.target
        this.setState({
            [name]:value
        })
    }

    handleClick(){
        if(this.state.password === ""){
            alert("--Unesite novu lozinku!--")
        }else{
            alert("--Uspesno ste izmenili lozinku--")
        }
    }

    render(){
        return(
            <div id="mojProfil">
                <MojProfilPrikaz state={this.state} />
                <h1>{this.state.password}</h1>
            </div>
        )
    }
}

export default MojProfil
